(6, 'Update', 'Versi 5.6', '1. Ganti Foto Profile(Account) dari Gallery (Setelah Login)\r\n2. Penambahan Fitur Tambah Laporan Kejadian untuk Petugas\r\n3. List Laporan Kejadian\r\n4. Pantauan Jumlah Petugas secara Realtime di Detail Laporan\r\n5. Perbaikan bug\r\n6. Perbaikan Fitur Pantau Petugas(Marker)\r\n7. Perkiraan Jarak di list laporan\r\n8. Perbaikan Notifications\r\n9. Penambahan Fitur Laporan Anda dan Detail Laporan\r\n10. Penambahan Fitur Log Laporan\r\n11. Penambahan Role\r\n\r\nnote : Aplikasi ini masih belum resmi. Masih dalam perbaikan dan penambahan fitur, sebelum siap digunakan.  ', 'https://play.google.com/store/apps/details?id=com.kominfo.panicapp', '2019-06-14'),
(7, 'Update', 'Versi 5.7', '1. Perbaikan bug\r\n2. Perkiraan Jarak di list laporan\r\n3. Perbaikan Notifications\r\n4. Nomor darurat bisa digunakan tanpa koneksi internet\r\n5. Pemberitahuan Update', 'https://play.google.com/store/apps/details?id=com.kominfo.panicapp', '2019-06-28'),
(8, 'Update', 'Versi 5.8', '1. Perbaikan bug\r\n2. Perbaikan Notifications\r\n', 'https://play.google.com/store/apps/details?id=com.kominfo.panicapp', '2019-07-16'),
(9, 'Update', 'Versi 5.9', '1. Perbaikan bug\r\n2. Perbaikan Notifications\r\n3. Ganti nama button\r\n4. Fitur kirim sms dan telpon pelapor', 'https://play.google.com/store/apps/details?id=com.kominfo.panicapp', '2019-08-05'),
