(413, 1, 99, 10, -7.554799530481568, 110.19856240600346, 'Jl. Rambutan Raya No.I/20, Tonogoro, Kalinegoro, Kec. Mertoyudan, Magelang, Jawa Tengah 56172, Indonesia,Kecamatan Mertoyudan,Jawa Tengah,Indonesia', '1313AugAug19191919031826laporan.jpg', '1313AugAug19191919031826selfie.jpg', '2019-08-13 10:18:00', 'selesai', 'Selasa, 13 Agustus  2019\r\n*KEJADIAN KEBAKARAN DAPUR*\r\nPerumnas Kalinegoro Jalan Rambutan 1 , Kalinegoro , Mertoyudan ,\r\n\r\n1.Waktu Kejadian : ± 09.00 wib\r\n*Info Diterima : 09.11 wib\r\n*Berangkat ke TKP : 09.13 wib\r\n*Sampai dilokasi : 09.15 wib\r\n*penanganan : 09.15 wib\r\n*Selesai penanganan : 09.43 wib\r\n\r\n2.Lokasi Kejadian : Perumnas Kalinegoro jalan rambutan 1, kalinegoro , mertoyudan .\r\n\r\n3.Cuaca\r\n*cerah mendukung*\r\n\r\n4.Jumlah Korban : Nihil\r\n5. Status : Nihil\r\n6.*PEMILIK Rumah*\r\n*Nama   : Ibu pratomo subroto\r\n7.kerugian : ±Rp. 1.500.000\r\n Saksi : Bp. Cokto guritno\r\n\r\n8.Kronologi : \r\nKetika Ibu pratomo sedang memasak menggunakan wajan , ada telfon kemudian ditinggal mengangkat telfon di ruangan depan , saat kembali ke dapur listrik padam kemudian wajan mengeluarkan api. Dan menyambar lemari piring disebelahnya . \r\nDan 4 rumah disebelahnya berhasil diamankan. \r\n\r\n\r\n9.Aksi yang dilakukan\r\nSetelah mendapat laporan damkar kabupaten magelang  , tim regu piket 1 induk segera menuju kelokasi ,kemudian melakukan pemadaman dengan Aman.\r\n\r\n 10.Regu yang menangani : REGU 1 \r\n12.Tim penyelamat :\r\n* Unit 03 \r\n* Unit 09\r\n*Unit 02\r\n*unit tanki\r\n* unit rescue\r\n* Unit Ambulance\r\n\r\n12. Instansi yang terlibat :\r\n1. DAMKAR KAB.MAGELANG\r\n2. Polsek Mertoyudan\r\n \r\n\r\nDemikian berita acara ini dibuat dengan sebenarnya sebagai bahan laporan kegiatan penyelamatan', '2019-08-13 10:53:00'),
