INSERT INTO `laporan_damkar` (`id_laporan_damkar`, `id_lapor`, `jenis_kejadian`, `penyebab_kejadian`, `nama_korban`, `alamat_korban`, `saksi`, `nama_pelapor`, `no_hp_pelapor`, `kerugian`, `kronologi`, `tindakan`, `obyek_terbakar`, `asal_api`, `ket_laporan`, `unit`, `regu`, `pos`) VALUES
(2, 386, 'OPERASI SARANG TAWON ', 'sudah membahayakan penghuni rumah dan warga yang melintas ', 'indah pujiati', 'DS DEYANGAN RT 02 RW 03 DEYANGAN ,MERTOYUDAN', 'IBU INDAH PUJIATI', NULL, NULL, 'tidak ada', 'REGU 2 INDUK DAMKAR KAB. MAGELANG SETLAH MENDAPAT LAPORAN KEMUDIAN MELUNCUR KELOKASI DAN LANGSUNG MENGEVAKUASI SARANG TAWON TERSEBUT DENGAN AMAN DAN SELAMAT', 'REGU 2 INDUK DAMKAR KAB. MAGELANG SETLAH MENDAPAT LAPORAN KEMUDIAN MELUNCUR KELOKASI DAN LANGSUNG MENGEVAKUASI SARANG TAWON TERSEBUT DENGAN AMAN DAN SELAMAT', 'xxx', 'xx', 'xx', NULL, NULL, NULL),
(3, 387, 'KEBAKARAN RUMAH ', 'KONSLETING LISTRIK ', 'BAPAK SOPIIN UMUR 52 TAHUN ', 'DIMIK RT 26 RW 12 PASANGSARI WINDUSARI', 'ZULHAM ', NULL, NULL, '70.000.000', 'DI DUGA KEBAKARAN DIAKIBATKAN KONSLETING LISTRIK DAN MENIMBULKAN PERCIKAN API DAN MENIMBULKAN TITIK API LALU MENJALAR DAN MERAMBAT KE ATAP RUMAH', 'DAMKAR KAB, MAGELANG MENDAPAT TELFON DARI BAPAK ZULHAM, POS WMK BANDONGAN LANGSUNG BERANGKAT KE LOKASI UNTUK MELAKUKAN PEMADAMAN KEBAKARAN. 80 RUMAH YANG TERSELAMATKAN DALAM KEJADIAN INI ', ' ', ' ', ' ', NULL, NULL, NULL),
(4, 391, 'KECELAKAAN LALU LINTAS', 'motor yang berkecepatan tinggi ', 'MAS AMRUL RIFAI', 'PANDEAN RT 27 RW 12 DEYANGAN MERTOYUDAN ', 'Algi nurudin (Damkar Kab Magelang)', NULL, NULL, '5.000.000', 'korban dari pandean dangean, mengendarai motor dengan kecepatan tinggi,  pak aksin pegawai dpu akan masuk ke kantor dpu dari arah yang berlawanan mengendarai mobil menyebrang pelan2,  dan mas amrul tidak bisa mengendalikan motor,kemudian korban terjatuh laka ini terjadi didepan DPUPR kabupaten magelang, \r\n\r\n', 'INDUK DAMKAR KAB MAGELANG MENDAPAT LAPORAN LAKA TERSEBUT DAN LANGSUNG MENUJU KELOKASI DAN KORBAN DIBAWA KE PUSKESMAS BOROBUDUR', NULL, NULL, NULL, NULL, NULL, NULL),
(5, 394, 'Kebakaran pabrik ', 'Oven terbakar', 'Paijo', '-', '-', NULL, NULL, '1.000.000.000.000,-', 'Lalai', 'Pada saat apel pagi, regu 3 mendapatkan telfon dari pabrik kayu di tonoboyo keji Muntilan terbakar, regu 3  induk langsung ke lokasi, disusu dengan WMK SALAMAN, MUNTILAN, TEMPURAN \r\n\r\n', 'Kayu', 'Rokok', 'Nothing', 'Satu', 'Macan Loreng', 'Sawitan'),
(6, 400, 'KEBAKARAN RUMAH ', 'PADA SAAT MEMBUKA AKSES JALAN UNTUK PELAKSANAAN PEMADAMDAMAN', 'SYARIF IBRAHIM', 'SOMOKERTO RT 01 RW 01 DESA SOMOKERTO KECAMATAN SALAM ', 'BAPAK MUHROZI', NULL, NULL, '+- Rp 20.000.000,00', 'sisa hasil perapian tungku yang masih ada bara ditinggal pemilik untuk istirahat diruangan rumah depan, yang mengakibatkan bara merembet ke serutan kayu yang berada disamping tungku dan mengakibatkan sumber api yang merembet ketumupukan kayu yang berada didalam dapur.', 'setelah mendapat informasi dari sodara Dino tim regu piket damkar Kab. Magelang segera menuju lokasi dan melakukan pemadaman dengan cepat, aman dan selamat ', NULL, NULL, NULL, 'UNIT 03, UNIT 09, UNIT 12, UNIT AMBULANCE, UNIT WM', '2', 'WMK MUNTILAN, WMK SALAM, INDUK'),
(7, 399, 'KEBAKARAN LAHAN ', 'PENYEMPROTAN LAHAN ', 'BAPAK SURYONO', 'DESA PERMITA RT 08 RW 02, BONDOWOSO KECAMATAN MERTOYUDAN KABUPATEN MAGELANG ', 'PRASETYO IMAN NUGROHO', NULL, NULL, '-', 'PEMILIK LAHAN BAPAK JUWARNO MEMBAKAR RUMPUT KERING DAN MENJALAR KE TUMPUKAN LIMBAH SAMPAH. BARA API TIDAK DAPAT PADAM DAN MENIMBULKAN ASAP, SEHINGGA MENGGANGU PERNAFASAN DAN AKTIFTAS WARGA', 'REGU PIKET DUA DAMKAR KABUPATEN MAGELANG SETELAH MENDAPAT LAPORAN KEMUDIAN MEMPERSIAPKAN PERALATAN DILANJUTKAN MENUJU KELOKASI DAN MELAKUKAN PENYEMPROTAN JALAN DENGAN AMAN DAN LANCAR', NULL, NULL, NULL, 'ZIGLER 03, AYAX 09 ', '2 DUA', 'INDUK'),
(8, 405, 'KEBAKARAN LAHAN ', 'Lahan bambu yang dibakar meluas ', '-', '-', '-', NULL, NULL, '-', 'ketika salah satu warga sedang membakar sebagian lahan bambu, api meluas dan warga kuwalahan untuk memdamkannya', 'setelah mendapat laporan dari waga tim regu piket 3 induk segera menuju kelokasi, kemudian melakukan pemadaman dengan aman', NULL, NULL, NULL, 'unit 03, unit 09, unit 05, unit rescue, unit ambul', '3', 'INDUK'),
(9, 409, 'KEBAKARAN BANGUNAN', 'sisa pembakaran sampah yang merambat di jerami kandang kambing', 'Bapak agus ', 'Jl. Kembangan, Kembangan, Sumberrejo, Kec. Mertoyudan, Magelang, Jawa Tengah 56172, Indonesia,Kecamatan Mertoyudan,Jawa Tengah,Indonesia', 'Bapak Mulyawan', NULL, NULL, 'kurang lebih Rp 5.000.000,-', 'Diduga dari sisa pembakaran sampah yang merambat di jerami kandang kambing sehingga menyebabkan sumber api', 'Setelah mendapat laporan Damkar Kabupaten Magelang, tim regu piket 2 Induk, WMK Tempuran, WMK Muntilan segera menuju kelokasi, kemudian melakukan pemadaman dengan Aman ', NULL, NULL, NULL, 'UNIT 03, UNIT 09, UNIT 07, UNIT 02, UNIT 10, UNIT ', '2', 'WMK TEMPURAN, WMK MUNTILAN, IN'),
(10, 410, 'OPERASI SARANG TAWON ', 'karena sudah membahayakan penghuni rumah', 'Novi', 'TIRTO RT 01 RW 09 PAREMONO MUNGKID', 'BAPAK BEJO MUNAWIR', NULL, NULL, '-', '-\r\n\r\nADANYA SARANG TAWON YANG BERADA DI SAMPING RUMAH IBU NOVI  YANG MERUPAKAN AKSES JALAN MASYARAKAT DIANGGAP MEMBAHAYAKAN PENHUNI RUMAH DAN WARGA SEKITAR YANG MELINTAS KEMUDIAN SAKSI MENGHUBUNGI KANTOR PEMADAM KEBAKARAN KABUPATEN MAGELANG', 'REGU PIKET DAMKAR KAB. MAGELANG SETELAH MENDAPAT LAPORAN KEMUDIAN MELUNCUR KELOKASI DAN LANGSUNG MENGEVAKUASI SARANG TAWON TERSEBUT DENGAN AMAN DAN SELAMAT', NULL, NULL, NULL, 'UNIT RESCUE', 'REGU 2', 'INDUK'),
(11, 413, 'KEBAKARAN BANGUNAN', 'sedang memasak menggunakan wajan , ada telfon kemudian ditinggal mengangkat telfon di ruangan depan  kemudiannya terbakar', 'Nihil', '-', 'Cokro guritno', NULL, NULL, '+- 1.500.000.-', 'rumah pak tomo\r\n\r\n', 'Setelah mendapat laporan damkar kabupaten magelang  , tim regu piket 1 induk segera menuju kelokasi ,kemudian melakukan pemadaman dengan Aman.', NULL, NULL, NULL, 'Unit 03  * Unit 09 *Unit 02 *unit tanki * unit res', '1', 'Induk dan WMK tempuran'),
(12, 414, 'KECELAKAAN LALU LINTAS', 'mengerem mendadak', 'Misbakhul Mustifa Dan Bapak Gunardi ', 'Misbakhul Mustifa Dusun Kretek II RT 01 RW 05 Desa Karangrejo Kecamatan Borobodur,Dan Bapak Gunardi Dusun Sodongan RT07 RW 06 Desa Bumirejo Kecamahtan Borobudur,', 'Dina (Anggota Damkar Kab. Magelang)', NULL, NULL, '-', '-\r\n\r\nKetika Pak Gunardi akan belok kanan ke arah Borobudur tiba-tiba dari belakang ada sepeda motor yang dikendarai sd. Misbakhul Mustofa kemudian menabrak kendaraan yang di Kendarai Bapak Gunardi', 'Setelah Mendapat laporan regu Piket Ambulance menindak lanjuti dan melakukan pertolongan pertama', NULL, NULL, NULL, 'Ambulance', '2 DUA', 'Induk'),
(13, 430, 'PENGAMBILAN KUCING DI SUMUR', 'Saat ibu Oik sedang memasak tiba- tiba ada suara yang jatuh kesumur, setelah dilihat ternyata seekor kucing. Lalu pemilik rumah menghubungi saudara minanda (anggota damkar)', 'PAK EKO BANYAK', 'Unnamed Road, Ngluwar, Magelang, Jawa Tengah 56485, Indonesia,Ngluwar,Jawa Tengah,Indonesia', 'EKO BANYAK dan ibu OIK', NULL, NULL, '-', 'Pemilik Pak Eko Banyak,,,Demangan Rt 5 Rw 3 ngluwar magelang\r\n\r\n-\r\n\r\n', 'REGU 3 MENDAPAT LAPORAN DARI MINANDA ORYZA PASUKAN DAMKAR KABUPATEN MAGELANG APABILA ADA KUCING MASUK SUMUR DI NGLUWAR ', NULL, NULL, NULL, 'UNIT AMBULANCE, UNIT HILUX', '3', 'WMK SALAM, POS INDUK'),
(14, 441, 'PENGAMBILAN SARANG TAWON', 'sangat  mengganggu kenyamanan penghuni  rumah  dan tamu...   karna begitu  bayak tawon yang liar.', 'panji', 'rt 02 rw 01 sidadap pandean ngablak', 'warga', NULL, NULL, '-', 'adanya sarang tawon di rumah bapak panji 002/001, sidadap, pandean, ngablak telah menggangu aktifitas dan membahayakan penghuni rumah. Lalu mas panji melapor ke Pemadam Kab Magelang untuk melalkukan evakuasi \r\n\r\n', 'Setelah mendapat laporan regu  piket WMK GRABAG langsung mempersiapkan peralatan dan segera meluncur ke lokasi untuk mengevakuasi sarang tawon tersebut dengan aman dan lancar', NULL, NULL, NULL, 'unit 05', '2', 'WMK GRABAG'),
(15, 439, 'KEBAKARAN ', 'kebocoran tabung gas', 'ibu Rini', 'Desa Krajan RT 1 RW 1 Desa Trasan, Kecamatan Bandongan, Kabupaten Magelang, Jawa tenggah', 'Ibu rini ', NULL, NULL, '-+ Rp 500.000,00', 'Ketika ibu Rini sedang memasak tiba - tiba api membesar dan api menyambar pada bagain regulator tabung yang diduga terdapat kebocoran pada regulator tersebut. Pemilik rumah langsung melaporkan kejadian tersebut melalui aplikasi SIYAP', 'Setelah menerima laporan VIA aplikasi SIYAP kemudian regu 2 WMK Bandongan meluncur kelokasi, melakukan pengecekan TKP dan tabung yang sempat terbakar. Serta memberikan pengarahan tentang penanganan kobocoran tabung gas.', NULL, NULL, NULL, '05', '2', 'Wilayah Manajemen Kebakaran Ba'),
(24, 484, 'Kecelakaan Lalu Lintas', 'Menghindari Lubang jalan sehingga terjatuh ', 'Bapak Suparmin', 'Dusun Karangrejo RT/RW:01/10, Desa Pucungrejo, Kecamatan Muntilan, Kabupaten Magelang ', 'Bapak Sodiq', '1. Dhiyan Febriyanto\r\n2. Tri Mulyono \r\n3. Muhammad Astri Handoko\r\n4. Muhammad Nurul Falah\r\n5. Khoero', '-', '-', 'Korban Mengendarai  sepeda Motor dari arah Muntilann menuju Borobudur dengan kecepatan tinggi, sesampainya di lokasi korban terpental karena menghindari lubang jalan sehingga terjatuh.', 'Setelah mendapat laporan Tim ambulance regu 03 Damkar Kab. Magelang menuju kelokasi untuk melakukan penanganan :\r\n1. Cek Kondisi Korban \r\n2. Membuka jalan nafas\r\n3. Stabilisasi Korban \r\n4. Pemberian oksigen \r\n5. Pembersihan Luka\r\n6. Mengevakuasi ke RSU Muntilan ', NULL, NULL, NULL, 'Ambulance', '3', 'Induk'),
(25, 485, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'Ibu Endang', 'Setyo Widi atmoko \r\nHeli wibowo \r\nHendra cahyo Wibowo \r\nSony Oktavianto\r\nCornelia Angesthi Widodo', 'Cornelia : 0813', '-', 'Adanya sarang tawon yang berada diatas Atap belakang rumah anggap membahayakan pemilik rumah dan warga sekitar yang melintas, maka saksi melapor ke kantor pemadam kebakaran Kab. Magelang ', 'Setelah mendapat laporan Tim Induk regu 2, menindak lanjuti laporan ke lokasi, melakukan asessment dan melakukan evakuasi sarang tawon dengan aman dan selamat', NULL, NULL, NULL, 'Hilux', '2', 'Induk'),
(26, 486, 'Tanah Longsor', 'Hujan Lebat ', '-', '-', 'warga sekitar ', 'Muhammad Jaga  Zaman, Romdhani, Muhammad Mukhlis, Muhammad Kukuh Prasetyo, Muhammad Soleh, Muhammad ', 'Rino Viantoro H', '-', 'Terjadi Hujan Lebat yang mengguyur Desa Banyusidi dan sekitarnya dan mengakibatkan tanah longsor di jalan Tanjakan sebanteng Banyusidi,\r\nAlat yang digunakan :APD , Cangkul, Nozle 1,5, selang 1,5, Y connection\r\nInstansi yang terlibat : Damkar Kabupaten Magelang, Polsek Pakis, Koramil Pakis, BPBD Magelang, TRC Kab. Magelang, Banser, Polhut, TNGM', 'setelah menerima laporan Tim WMK Tegalrejo menuju lokasi untuk mengkondisikan tanah longsor dengan aman dan lancar', NULL, NULL, NULL, 'WMK TEGALREJO', '2', 'WMK Tegalrejo'),
(27, 487, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', 'warga setempat', '-', 'Bapak Taryono', '-', 'Fadila : 081575', '-', 'Sarang Tawon yang berada di atap rumah Bapak Taryono ', 'Regu 2 mendapat laporan dari saksi dan langsung menindaklanjuti laporan', NULL, NULL, NULL, 'Hilux', '3', 'Induk'),
(28, 488, 'Penyemprotan Disinfektan', 'permintaan  Pemerintah desa Srumbung untuk menyemprot disinfektan ', '-', '-', 'warga sekitar ', 'Hendra apriansyah ', 'Hendra apriansy', '-', 'Berdasar Surat Permohonan dalam rangka mengantisipasi dan memutus penyebaran Virus Corona (Covid 19) Pemerintah desa Srumbung meminta bantuan penyemprotan disinfektan', 'Setelah mendapat perintah dari pimpinan 1 Tim Pemadam Kebakaran kabupaten magelang melaksanakan kegiatan penyemprotan dengan aman.', NULL, NULL, NULL, 'Hilux', '1', 'Induk'),
(29, 489, 'Evakuasi Laka Sungai ', 'Diduga hilang kendali, mengakbatkan korban terperosok ke sungai ', 'Bapak Arwanto', 'Kujon, 03/11, Kecamatan Borobudur, Kabupaten Magelang', 'Nur Fauzan', 'Tim Rescue Hilux\r\nTim Ambulance', 'Nur Muhammad Al', '-', 'Diduga hilang kendali, sehingga mengakibatkan korban terperosok kesungai', 'Setelah mendapatkan laporan, Team regu piket menindak lanjuti dan menuju lokasi untuk melakukan pertolongan , mengevakuasi dan mobilisasi korban ke RSU Muntilan ', NULL, NULL, NULL, 'Ambulance dan hilux', '3', 'Induk'),
(30, 490, 'Penanganan Korban Tersengat Listrik', 'karena secara tidak sengaja galvalum menyentuh kabel listrik dengan tegangan 12.000 volt', 'Nurhadi', 'Gales RT 04 RW 02, Sidorejo ,Kecamatan Tegalrejo, Kabupaten Magelang', 'Bapak Yanto dan Bapak Sudarsono ', 'Bramantyo Dwi Listanto', '085799312290', '-', 'Bp Nurhadi sedang melaksanakan pekerjaan pembangunan ruko di lantai 3 dengan menggunakan gavalum (Baja Ringan), secara tidak sengaja galvalum menyentuh kabel listrik dengan tegangan 12.000 volt, sehingga korban tersengat listrik, \r\n', 'Setelah menerima laporan dari saksi tim Rescue dan Medis Pemadam Kebakaran Kabupaten Magelang merespon laporan dengan menuju ke lokasi, dan melakukan penanganan :\r\n° Asesment korban (korban luka bakar derajat 2-3 seluas 75-90% di sekujur tubuh) \r\n° Stabilisasi korban\r\n° Membebaskan korban dari pakaian yang terbakar\r\n° Mobilisasi dan Evakuasi ke RSUD Tidar Kota Magelang ', NULL, NULL, NULL, 'Hilux dan Ambulance', '2', 'Induk'),
(31, 491, 'Kecelakaan Lalu Lintas', 'Bersenggolan antar sepeda motor', 'Ny. Retno Prihatiningsih / Nn. Prasasti Sekar Fitri', 'Tegal Slerem 03/01, Sedayu, Kec. Muntilan / Jl. Badrawati, Kec. Borobudur, Kab. Magelang\r\n', 'Dhiyan Febrianto', '1. Kiswoto\r\n2. Yogo Tri S\r\n3. Wisnu Kusuma\r\n4. Bramantyo\r\n5. Gema Sasmita', '085879993822', '-', 'Ny. Retno mengendarai SPM dari arah Palbapang menuju ke Mungkid, sesampainya di depan Puri Menoreh Ngrajeg hendak mendahului Truk didepannya, namun dari arah bersamaan Nn. Sekar hendak mendahului truk dan Ny. Retno sehingga kedua SPM bersenggolan dan terjatuh. ', 'Setelah mendapatkan laporan tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Pembidaian kaki Kanan Nn. Sekar (Dislokasi tumit kanan) \r\n4. Pembalutan Luka sobek di tumit kanan Ny. Retno\r\n5. Evakuasi Korban Ke RSUD Muntilan', NULL, NULL, NULL, 'Ambulance', '2', 'Induk'),
(32, 492, 'Dropping Air Bersih', '-', '-', '-', '-', '085725193101', 'Agus Santoso', '-', 'Regu 1 induk mendapat perintah dari Ka UPT Penanggulangan Kebakaran Kab. Magelang untuk mengisi air bersih untuk pengungsi dari desa Keningar, Kecamatan Dukun Kabupaten Magelang. ', 'Tangki 06 mendropping air di lokasi', NULL, NULL, NULL, '06', '1', 'Induk'),
(33, 493, 'Dropping Air Bersih', '-', '-', '-', 'Relawan pos Lapangan Stovia Tamanagung Muntilan', 'Joko Wahyu Nugroho', '085730040286', '-', 'Setelah mendapat laporan dari relawan untuk membutuhkan air bersih,Tim Regu 3 mensuplay air bersih menggunakan tangki 06.', 'Tangki 06 beserta Tim melaksanakan Dropping Air bersih ', NULL, NULL, NULL, '06 tangki', '3', 'Induk'),
(34, 494, 'Dropping Air Bersih', 'Minimnya air Bersih', '-', '-', '-', 'Ari Kuswanto', '08812484009', '-', 'Tim Induk mendapat laporan lokasi Pengungsian TEA gedung PPP Prumpung Taman agung Muntilan membutuhkan air bersih, dan langsung ditindak lanjuti untuk dropping air bersih, oleh Tangki 06 kelokasi pengungsian.', 'Tangki 06', NULL, NULL, NULL, '06 tangki', '3', 'Induk'),
(35, 495, 'Kecelakaan Lalu Lintas', 'hilangan kesadaran sehingga menyebabkan korban terjatuh.', 'Bambang Suminto', 'Dsn Sewan Rt 37 Rw 14. Ds Menoreh. Kec Salaman. Kab Magelang.', 'Relawan Grup Rescue', 'Dhiyan Febrianto', '081807761960', '-', 'Korban pulang dari muntilan menggunakan sepeda motor, sesampainya di jalan borobudur-salaman korban kehilangan kesadaran sehingga menyebabkan korban terjatuh.\r\n', 'Setelah mendapatkan laporan tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Mengavakuasi korban ke Puskesmas Salaman 1\r\n', NULL, NULL, NULL, 'Ambulance', '3', 'Induk'),
(36, 496, 'Penyemprotan Disinfektan', 'Covid 19 ', '-', '-', '-', 'Fatchur Rohman', '088980511835', '-', 'Dalam rangka memutus mata rantai Penyebaran covid 19, Setiap hari Sabtu Pagi, Tim Induk melaksanakan penyemprotan disinfektan di rumah Dinas Bupati Magelang', 'Melaksanakan kegiatan rutin Penyemprotan Disinfektan setiap hari Sabtu ', NULL, NULL, NULL, 'Hilux', '3', 'Induk'),
(37, 497, 'Pengambilan Ular', 'Karena ditemukan ular yang membahayakan warga diarea rumah', '-', '-', 'Bapak Aziz', '1. M.jaga zaman\r\n2. Romdani\r\n3. Agus purwanto\r\n4. M.mukhlis\r\n5. M.soleh\r\n6. M.kukuh\r\n7. M.afif sarif', 'Muhammad Soleh ', '-', ' Adanya ular yang masuk dalam dapur,dan membahayakan pemilik rumah kemudian pemilik rumah melapor ke wmk tegalrejo. ', 'Setelah mendapat laporan tim piket regu 2 wmk tegalrejo menindak lanjuti laporan,  menyiapkan peralatan serta personil dan mengevakuasi ular tersebut dengan aman dan selamat.', NULL, NULL, NULL, 'WMK TEGALREJO', '1', 'WMK Tegalrejo'),
(38, 498, 'Kecelakaan Lalu Lintas', 'menghindari tumpukan material', 'Nama korban : 1.Ny. Munasaroh (40 th/ LB) , 2. Nama korban : Bp. Agus Sukoco ( 46 th/ LS)   3. Nama korban : An. Zainul Anwar (5 th/ LS)  ', '1Alamat korban: Carikan, Ringin Anom, Tempuran, 2.Alamat korban: Carikan, Ringin Anom, Tempuran 3.Alamat korban: Carikan, Ringin Anom, Tempuran', 'Warga yang melintas', '1. Kiswoto\r\n2. Yogo Tri S\r\n3. Wisnu Kusuma\r\n4. Bramantyo\r\n5. Dekki', 'Bramantyo Dwi L', '-', 'Tn. Agus berboncengan dengan Ny. Munasaroh dan An. Zainul Anwar dari arah Carikan Tempuran menuju ke Muntilan, setibanya di pertigaan Mendut tepatnya di depan kolam renang Mendut sepeda motor menggunakan jalur kiri dan berusaha menghindari tumpukan material di depannya namun di samping motor terdapat mobil yang melaju sehingga korban menabrak bagian samping mobil dan terjatuh. \r\n', 'Setelah mendapatkan laporan tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Pemasangan OPA pada Ny. Munasaroh\r\n4. Depp luka sobek Ny. Munasaroh di kepala\r\n5. Pemberian O2 3lpm\r\n6. Pembalutan Luka sobek (susp Fraktur) di jempol kaki kanan Tn. Agus\r\n7. Evakuasi ke RSUD Muntilan\r\n', NULL, NULL, NULL, 'Ambulance', '2', 'Induk'),
(39, 499, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'BPK . Slamet', '1. Nur Sigit W\r\n2. Salist Arif M\r\n3. Dwi Marwanto \r\n4. M. Saputro\r\n5. M. Sigit S\r\n6. Rian\r\n7. Toni S', 'rian damkar: 08', '-', 'Dengan adanya Sarang tawon yang berada di halaman Sekolah SMP Negeri 1 Kaliangkrik yang bisa membahayakan aktivitas di Sekolah sehingga saksi Bpk . Slamet melapor ke WMK Bandongan', ' Tim piket regu 2 Wmk Bandongan yang menerima laporan merespon laporan tersebut . kemudian tim menyiapkan personil dan alat lalu menuju lokasi , dan sarang tawon dapat di kondisikan dengan aman dan selamat\r\n', NULL, NULL, NULL, 'Unit Bandongan', '2', 'WMK Bandongan'),
(40, 500, 'Penanganan Pohon Tumbang', 'Terjadi hujan lebat disertai angin mengakibatkan pohon tumbang, ', '-', '-', 'Polsek Bandongan', '1. Adelouis Marchelino\r\n2. Rudiyanto\r\n3. M. K. Alfan\r\n4. Ardi Murdianto\r\n5. Tito Firmansah\r\n6. Eko S', 'Budiyarsih: 085', '-', 'Terjadi hujan lebat disertai angin pada malam Senin mengakibatkan pohon tumbang, kemudian saksi melaporkan ke WMK Bandongan', 'Setelah menerima laporan  tim WMK Bandongan menuju kelokasi untuk mengkondisikan pohon tumbang dengan aman dan lancar.', NULL, NULL, NULL, 'WMK Bandongan', '3', 'WMK Bandongan'),
(41, 501, 'Penanganan Pohon Tumbang', 'Pohon rapuh dan terkena angin kencang', '-', '-', 'Bapak supriyadi ', '  1. Andi R\r\n   2. Listiyanto\r\n   3. Fatchur\r\n   4. Aziz\r\n   5. Aliazhar\r\n   6. Hari Murti\r\n  ', '088980511835', '-', 'pohon yang sudah rapuh terkena tiupan angin kencang mengakibatkan terjadinya pohon tumbang yang menghalangi akses jalan raya,\r\n kemudian saksi melapor ke anggota Damkar Kab. Magelang.', 'Setelah menerima laporan dari saksi kemudian tim piket regu 3 Induk menyiapkan alat dan personil menuju ke lokasi kejadian.', NULL, NULL, NULL, 'Hilux', '3', 'Induk'),
(42, 502, 'Penyemprotan Disinfektan', 'permintaan  Pemerintah desa Srumbung untuk menyemprot disinfektan ', '-', '-', '-', '1. Andrie W\r\n2. A. Ruslan\r\n3. Nur faizin\r\n4. Edy\r\n5. Hendrawan\r\n6. WMK Salam', 'Zulfa Nur Aniss', '-', 'Berdasar Surat Permohonan, dalam rangka mengantisipasi dan memutus penyebaran Virus Corona (Covid-19), Pemerintah Desa Srumbung meminta bantuan penyemprotan desinfektan.\r\n', 'Setelah mendapat perintah dari Pimpinan, 1 Tim Pemadam Kebakaran Kab. Magelang melaksanakan kegiatan penyemprotan dengan aman.', NULL, NULL, NULL, 'Hilux', '1', 'Induk'),
(43, 503, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'Bp. Napi (Pemilik Rumah)', '1. M. Jaga\r\n2. Romdhani\r\n3. Agus P\r\n4. M. Soleh\r\n5. M. Mukhlis\r\n6. M. Kukuh P\r\n7. M. Afif\r\n8. Chabib', 'dzakia toyib mu', '-', 'Adanya sarang tawon yang berada diatap rumah warga dan mengganggu aktifitas warga, kemudian Bpk  Napi melapor ke pos WMK Tegalrejo\r\n', 'Setelah mendapat laporan , Petugas Piket Regu 2 WMK Tegalrejo menyiapkan peralatan serta personil , kemudian meluncur ke lokasi dan mengevakuasi sarang tawon tersebut dengan aman & selamat. \r\n', NULL, NULL, NULL, 'WMK TEGALREJO', '1', 'WMK Tegalrejo'),
(44, 504, 'Kecelakaan Lalu Lintas', ' korban terkejut dan oleng mengakibatkan terjatuh', 'Sdr. Muhammad Luthfi (18 th) dan Sdr. Muhammad Iltimasabud Adam (25 th) ', 'Jetis, Ngadirejo, Salaman dan  Tejosari, Parakan, Temanggung', ' Bu Nur ( Relawan ) ', '1. Kiswoto\r\n2. Yogo Tri S\r\n3. Wisnu Kusuma\r\n4. Bramantyo\r\n5. Sony Oktavian', 'Bramantyo Dwi L', '-', 'Korban mengendarai SPM berboncengan dari arah Salaman menuju Jetis, setibanya di Dadapan ada pejalan kaki hendak menyeberang jalan sehingga korban terkejut dan oleng hingga terjatuh. \r\n', 'Setelah mendapatkan laporan tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Perawatan Luka\r\n4. Evakuasi ke Puskesmas Salaman', NULL, NULL, NULL, 'Ambulance', '2', 'Induk'),
(45, 505, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'Bp. M arifin (Pemilik Rumah)', '1. Arif S\r\n2. Sulistyono\r\n3. M Anas N\r\n4. Agung\r\n5. Imam W\r\n6. Bachtiar R\r\n7. Triyas Hp\r\n', 'Triyas Huda Pam', '-', 'Adanya sarang tawon yang mengganggu aktifitas warga dan adanya warga yang tersengat.kemudian Bpk M arifin melapor ke pos WMK GRABAG', 'Setelah mendapat laporan , Petugas Piket Regu 1 WMK Grabag menyiapkan peralatan serta personil , kemudian meluncur ke lokasi dan mengevakuasi sarang tawon tersebut dengan aman & selamat. ', NULL, NULL, NULL, 'WMK Grabag', '1', 'WMK Grabag'),
(46, 506, 'Penanganan Pohon Tumbang', 'karena hujan dengan intensitas  tinggi disertai anginb kencang', '-', '-', 'warga sekitar ', '1. Chabib\r\n2. Prasetio Iman\r\n3. Febriyan Ramadhani\r\n4. Wahyu Ardanto\r\n5. Septian DC\r\n6. Dzakia Toyib', 'Wahyu Ardanto :', '-', 'Terjadi hujan dengan intensitas  tinggi disertai angin menyebabkan pohon albasia tumbang dan menutup total Jln Pisangan - Candimulyo, kemudian saksi melapor ke Damkar Kab. Magelang Pos Tegalrejo untuk ditinjak lanjuti.\r\n', 'Setelah menerima laporan  regu piket  Wmk Tegalrejo menuju ke lokasi untuk melakukan evakuasi  dengan aman dan lancar.\r\n', NULL, NULL, NULL, 'WMK TEGALREJO', '1', 'WMK Tegalrejo'),
(47, 507, 'Penyemprotan Disinfektan', 'Penyemprotan desinfektan , dalam rangka sterilisasi lingkungan dari covid 19', '-', '-', '-', '- Edy\r\n- Andrie \r\n- Faizin \r\n- Hendrawan\r\n- Malik', 'Salsabila Furqo', '=', 'dalam rangka sterilisasi lingkungan dari covid 19 maka regu 1 induk melaksanakan Penyemprotan desinfektan  di kantor BAWASLU Kab. Magelag ', 'Setelah mendapat perintah dari pimpinan, Regu piket Pemadam Kebakaran Kab.Magelang melaksanakan kegiatan penyemprotan dengan aman.', NULL, NULL, NULL, 'Hilux', '1', 'Induk'),
(48, 508, 'Evakuasi dan Mobilisasi Orang Pingsan', 'korban lemas dan terjatuh.', 'Ny.Is', 'Kadiwongso, Salaman, Kabupaten Magelang', 'WMk Tempuran', '1. Rizal\r\n2. Anugrah\r\n3. Atik\r\n4. Yudhistira\r\n5. Cipto\r\n6. A. Ruslan ', '082225139863', '-', 'Korban berboncengan sepeda motor dari Demesan, Tempuran menuju Kadiwongso, Salaman. Sesampai d lokasi, korban lemas dan terjatuh.\r\n', 'Setelah mendapat laporan, tim Ambulance Damkar Kab Magelang menuju lokasi untuk melakukan assesmen, penangan dengan pemberian oksigen kemudian mengevakuasi korban menuju RSUD Tidar.\r\n', NULL, NULL, NULL, 'Ambulance', '1', 'Induk'),
(49, 509, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'Bp. Anang & Bpk Ismana Ibrahim (Pemilik Rumah)', '1. Abi akbar A\r\n2. Listiyanto\r\n3. Fatchurohman\r\n4. Bagas H\r\n5. Aliazhar\r\n', '088980511835', '-', 'Pada hari jumat, 13 November 2020, telah terjadi hujan lebat disertai angin. Menyebabkan tawon yang bersarang dibelakang rumah kediaman Bp. Ismana terusik dan berhamburan keluar, kemudian masuk ke dalam rumah. \r\nSarang tawon tersebut dianggap membahayakan oleh pemilik rumah, setelah itu saksi melapor ke Kantor Pemadam Kebakaran Kab. Magelang. ', 'Setelah mendapat laporan , Petugas Piket Regu 3 Induk menyiapkan peralatan serta personil , kemudian meluncur ke lokasi dan mengevakuasi sarang tawon tersebut dengan aman & selamat. ', NULL, NULL, NULL, 'Hilux', '3', 'Induk'),
(50, 510, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', ' Abdul Rahman (5 th)', 'Dsn. Candran RT 03 RW 09 Ds.Danurejo ,Kec. Mertoyudan', 'Ibu Sarifatun', '1. Setyo Widi A\r\n2. Mustaqim\r\n3. Dwi Ariyanto\r\n4. Dekky Swargana\r\n5. Sumarsih DL', 'Sumarsih Dwi Le', '-', ' Adanya sarang tawon yang berada tembok taman depan rumah yang di anggap membahayakan pemilik rumah dan sudah menimbulkan korban ,maka saksi melapor ke kantor pemadam kebakaran Kab.magelang', 'Setelah mendapat laporan, Tim induk regu 2 menindak lanjuti laporan ke lokasi, melakukan asessment dan melakukan evakuasi sarang tawon dengan aman dan selamat.\r\n', NULL, NULL, NULL, 'Hilux', '2', 'Induk'),
