(60, 520, 'Penanganan Pohon Tumbang', 'Hujan Lebat ', '-', '-', 'Sukir', '   1. Bayu Kusumo\r\n   2. Sulistiyono\r\n   3. Muhammad Anas Naschoha\r\n   4. Choirul Anam\r\n   5. Sigit ', 'Triyas Huda Pam', '-', 'Hujan lebat yang disertai angin mengakibatkan terjadinya pohon tumbang yang menimpa akses jalan  mengakibatkan pengendara motor dan mobil terhalang ketika melintas, kemudian saksi melapor ke anggota Damkar Kab. Magelang.', 'Setelah menerima laporan dari saksi kemudian tim piket regu 1 Wmk Grabag menyiapkan alat dan personil menuju ke lokasi kejadian.\r\n', NULL, NULL, NULL, 'WMK Grabag', '1', 'WMK Grabag'),
