(62, 522, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', ' (Pekerja bangunan di rumah bu miska)', 'Dsn. Kedon RT 03 RW 02 Ds. Pasuruhan ,Kec. Mertoyudan', 'Miska', '1. Dwi A\r\n2. Hendrajid M\r\n3. Banu K\r\n4. Dekky S\r\n5. Diky N.C\r\n6. Robby F\r\n', 'Dekky Swargana:', '-', 'Adanya sarang tawon yang berada di Atap samping rumah  yang di anggap membahayakan pemilik rumah dan sudah menimbulkan korban pekerja bangunan di rumah bu miska ,maka saksi melapor ke kantor pemadam kebakaran Kab.magelang', 'Setelah mendapat laporan, Tim induk regu 2 menindak lanjuti laporan ke lokasi, melakukan asessment dan melakukan evakuasi sarang tawon dengan aman dan selamat.', NULL, NULL, NULL, 'Hilux', '2', 'Induk'),
