(79, 539, 'Penanganan Pohon Tumbang', 'Hujan Lebat  dan angin kencang', '-', '-', ' Bpk Kusnadi (Pemilik Kebun)', '1. Chabib\r\n2. Prasetio Iman Nugroho\r\n3. Febriyan Ramadhani\r\n4. Wahyu Ardanto\r\n5. Septian DC\r\n6. Dzak', '082226572218', '-', 'Terjadi hujan dengan intensitas  tinggi disertai angin kencang di wilayah Candimulyo dan sekitarnya  menyebabkan pohon kelapa tumbang dan  menimpa kabel listrik yang membahayakan  rumah  Bpk Sabar dan rumah Bpk Kusdi , kemudian saksi melapor ke Damkar Kab. Magelang Pos Tegalrejo untuk ditinjak lanjuti.', 'Setelah menerima laporan  regu piket  Wmk Tegalrejo menuju ke lokasi untuk melakukan evakuasi  bersama PLN Tegalrejo dan Koramil Candimulyo dengan aman dan lancar.', NULL, NULL, NULL, 'WMK TEGALREJO', '1', 'WMK Tegalrejo'),
(80, 540, 'Kecelakaan Lalu Lintas', 'tabrakan beruntun', 'terlampir di keterangan pelapor', 'terlampir di keterangan pelapor', 'warga', '1. Rizal\r\n2. Anugrah \r\n3. Atik\r\n4. Yudhistira\r\n5. Cipto ', '081805896676', '-', ' Kedua kendaraan melaju dari arah sawitan, Tn. Zazid hendak menyebrang kemudian dari arah belakang melaju Sdr. Juli yang berboncengan dan menabrak dari arah belakang sehingga ketiga korban terjatuh. ', 'Setelah mendapatkan laporan Tim Ambulance Damkar  Kab. Magelang menuju ke lokasi untuk melakukan assesment, cek kondisi umum, dan perawatan luka, kemudian mengevakuasi ke Puskesmas Borobudur. ', NULL, NULL, NULL, 'Ambulance', '1', 'induk'),
(81, 541, 'Penyemprotan Disinfektan', 'Corona Virus Disease 19', '-', '-', 'Karyawan dan Kayawati Pemda Kabupaten Magelang', '- G. Yudha\r\n- A. Akbar A\r\n- Fatchur R\r\n- Bagas H\r\n- N.M Ali', '085701009009', '-', 'Dalam rangka memutus penularan Covid-19 maka damkar kabupaten magelang melaksanakan  penyemprotan desinfektan sesuai perintah dan dilaksanakan dengan aman ', 'Menyikapi perintah penyemprotan desinfektan', NULL, NULL, NULL, 'Hilux', '3', 'Induk'),
(82, 542, 'Penyemprotan Disinfektan', 'Corona Virus Disease 19', '-', '-', 'Karyawan dan Karyawati Kecamatan Bandongan Kabupaten Magelang', 'Tito Firmansyah', '085602151621', '-', 'WMK Bandongan melaksanakan penyemprotan disinfektan di lingkungan kantor kecamatan Bandongan dengan aman', 'Dalam rangka memutus mata rantai covid 19 ', NULL, NULL, NULL, 'WMK Bandongan', '3', 'WMK Bandongan'),
(83, 543, 'Kebakaran Mobil', NULL, 'Bapak Eko', 'Dusun Kedon RT 03 RW 02, Desa Pasuruhan, Kecamatan Mertoyudan, Kabupaten Magelang', NULL, 'Sumarsih Dwi Lestari', '085921572510', '2000000', 'Saksi mendengar suara seperti buah mangga yang jatuh di atap rumah. Kemudian saksi mencari sumber suara dan ternyata melihat mobil di garasi sudah terbakar.', NULL, 'Mobil', 'Mobil', 'Tindakan :\r\nSetelah mendapat laporan, Tim melakukan persiapan dan meluncur ke lokasi kejadian. Api sudah dipadamkan oleh warga, Team melakukan pendinginan agar tidak merembet ke pemukiman disekitar mobil terbakar.\r\n\r\nPemilik Mobil :\r\nBapak Eko\r\n\r\nKerugian :\r\n+- Rp 20.000.000,-\r\n\r\nTerselamatkan :\r\n2 Rumah warga, Gudang LPG, & Mushola\r\n', 'ziegler 03, Ayax 09, Hilux, dan Ambulance', '2', 'Induk'),
(84, 544, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'Bapak Roni', 'Ratna Dwi lestari', '085878542160', '-', 'Adanya sarang tawon yang berada di pohon Rambutan yang di anggap membahayakan pengunjung dan petugas Candi ,maka saksi melapor ke kantor pemadam kebakaran Kab.magelang\r\n', 'Setelah mendapat laporan, Tim induk regu 2 menindak lanjuti laporan ke lokasi, melakukan asessment dan melakukan evakuasi sarang tawon dengan aman dan selamat.', NULL, NULL, NULL, 'Hilux', '2', 'Induk'),
(85, 545, 'Pembersihan Jalan Akibat Tumpahan BBM/Tanah Longsor/Pasir', 'oli yang tercecer dijalan raya', 'Jalu sandi Prabowo', 'Karangsari, Blangkunan Selatan, Pabelan, Mungkid, Magelang', '-', 'Sumarsih Dwi lestari', '081227175615', '-', 'Adanya tumpahan solar dijalan sigug yang telah mengakibatkan pengguna jalan terjatuh.', 'Setelah mendapatkan laporan dari warga,maka  Tim Pemadam Kebakaran Kab. Magelang melaksanakan kegiatan penyemprotan dengan aman', NULL, NULL, NULL, 'ziegler 03', '2', 'Induk'),
(86, 546, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', ' Ibu Dwi Rohani (Pemilik Rumah)', 'Tony Setiawan', '085875742378', '-', 'Adanya sarang tawon yang berada di depan rumah saksi dan mengganggu aktifitas warga, kemudian saksi melapor ke kantor pemadam', 'Setelah mendapat laporan , Petugas Piket Regu 2 menyiapkan peralatan serta personil , kemudian meluncur ke lokasi dan mengevakuasi sarang tawon tersebut dengan aman & selamat. ', NULL, NULL, NULL, 'WMK Bandongan', '2', 'WMK Bandongan'),
(87, 547, 'Kecelakaan Lalu Lintas', 'Tumpahan Olie', 'Sdr. Jalu Sandi Prabowo (21 th) ', 'Karangsari, Blangkunan Selatan, Pabelan, Mungkid, Magelang', 'Warga', 'Yogo Tri Subarkah', '081392082792', '-', 'Korban mengendarai SPM berboncengan dari arah Kota Magelang (Jagoan) menuju Candi Mendut, setibanya di tikungan desa Ngroto terdapat tumpahan solar di jalan sepanjang tikungan, sehingga korban terpeleset, oleng, hingga terjatuh dan bagian dada terbentur. ', 'Setelah mendapatkan laporan tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Perawatan Luka di Ambulan\r\n4. Pemberian O2 3 lpm\r\n5. Evakuasi ke Puskesmas Borobudur', NULL, NULL, NULL, 'Ambulance', '2', 'Induk'),
(88, 548, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'Bp. Galih (Pemilik Rumah', 'Gunawan Yudha Prasetya', '088980511835', '-', 'Adanya sarang tawon yang berada di pohon nangka depan rumah pemilik, yang mengganggu pekerja bangunan. kemudian pemilik rumah melapor ke damkar', 'Setelah mendapat laporan , Petugas Piket Regu 3 menyiapkan peralatan serta personil , kemudian meluncur ke lokasi dan mengevakuasi sarang tawon tersebut dengan aman & selamat. ', NULL, NULL, NULL, 'Hilux', '3', 'Induk'),
(89, 549, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'Bp. Dodo (Pemilik Rumah)', 'gunawan Yudha Prasetya', '088980511835', '-', 'Adanya sarang tawon yang berada di atap belakang rumah pemilik, kemudian pemilik rumah melapor ke damkar', 'Setelah mendapat laporan , Petugas Piket Regu 3 menyiapkan peralatan serta personil , kemudian meluncur ke lokasi dan mengevakuasi sarang tawon tersebut dengan aman & selamat. ', NULL, NULL, NULL, 'Hilux', '3', 'Induk');
