(197, 657, 'Evakuasi Laka Sumur', 'kucing masuk sumur', 'Chicko seekor kucing', 'Gunungsari Gulon Kecamatan Salam Kabupaten Magelang', 'Ibu Ning ', 'Fatchurrohman', '085600899244', '-', 'ketika saksi mencari kucingnya ternyata sudah masuk kedalam sumur semenjak tadi malam, diduga kucing karena mengejar tikus, dan terjebur kesumur, maka saksi melapor ke Damkar Kabupaten Magelang', 'setelah mendapat laporan maka regu 3 induk menuju kelokasi dan mealkukan evakuasi dengan aman dan selamat', NULL, NULL, NULL, 'Hilux dan Ambulance', '3', 'Induk'),
