(341, 801, 'Kecelakaan Lalu Lintas', 'Hilang kendali', 'Nama korban  Ibu Purwanti (30 tahun)  ', 'Alamat korban Soka, Mertoyudan, Kab.Magelang ', 'Muhammad Al Baechaki', 'Khoerotul Laela', '0856-0163-7282', '-', '\r\n\r\nKorban sedang berlatih mengemudi di lapangan Pasuruhan. namun ketika hendak keluar menuju jalan raya korban mengalami hilang kendali, kemudian menabrak mobil sehingga mengakibatkan kecelakaan beruntun yang melibatkan 4 kendaraan mobil. ', '\r\nSetelah mendapatkan laporan tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Mengevakuasi korban ke Puskesmas Borobudur. \r\n\r\n', NULL, NULL, NULL, '13', '3', 'Induk'),
(342, 802, 'Evakuasi Binatang Buas', 'Dikarenakan membahayakan kandang ayam lingkungan sekitar', 'Diky Nur Cahyo', 'Sekaran Banyurojo Magelang', 'Bapak M. Khoirun Naksir', 'Cornelia Angesthi Widodo', '+62 813-2619-27', '-', 'Adanya laporan untuk mengevakuasi seekor anjing yang membahahayakan pemilik kandang dan warga sekitar. Kemudian saksi melapor ke anggota Damkar Kab. Magelang', '\r\nTim induk regu 2 setelah mendapat laporan segera menindak lanjuti dan melaksanakan evakuasi anjing dengan aman', NULL, NULL, NULL, '08', '2', 'Induk'),
(343, 803, 'Pembersihan Tanah Longsor', 'Hujan deras', '-', '-', 'Bapak yoyok', 'Budiyarsih', '+62 858-7547-94', '-', 'Hujan deras dengan instensitas tinggi menyebabkan akses jalan utama dusun Mudan longsor dan tidak bisa dilewati. maka saksi melapor ke Pos Wmk Bandongan', '\r\n\r\nSetelah mendapat laporan, Team piket Wmk Bandongan Regu 2 menindak lanjuti laporan tersebut  lalu  melaksanakan pembersihan material tanah longsor dengan aman dan selamat dan akses jalan utama dusun Mudan sudah bisa dilewati.', NULL, NULL, NULL, '04', '2', 'Wmk bandongan'),
(344, 804, 'Kecelakaan Lalu Lintas', 'berusaha menghindari truk ', 'Muhammad Rosyid Ridho', 'Watusari Rt. 03 Rw. 06, Kecamatan Muntilan, Kabupaten Magelang', 'Gunawan Yudha Prasetya', 'Wisnu kusuma Wardhana ', '+62 858-7999-38', '-', 'Korban berboncengan dengan istri dan anaknya mengendarai SPM dari arah Muntilan menuju Mertoyudan, korban berusaha menghindari truk dan menyalip dari sisi kiri yang mengakibatkan korban menabrak trotoar dan terjatuh. ', '\r\n\r\nTindakan : Setelah menerima laporan, tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Perwatan luka sobek di tumit kiri +/- 6cm\r\n4. Pembalutan luka sobek\r\n5. Evakuasi korban ke IGD Puskesmas Mertoyudan 1\r\n\r\n', NULL, NULL, NULL, '13', '3', 'Induk'),
(345, 805, 'Pembersihan Jalan Akibat Tumpahan BBM/Tanah Longsor/Pasir', 'Pasir yang tercecer dijalan', '-', '-', 'Didik wahyu nugroho', 'Muhammad afif', '+62 857-4737-91', '-', 'Adanya tumpahan pasir dari truck yang tercecer dijalan yang membahayakan pengguna Jalan, kemudian saksi melaporkan ke Damkar kabupaten magelang', 'Setelah mendapat laporan wmk Muntilan regu 1 segera menindak lanjuti laporan dengan aman', NULL, NULL, NULL, '10', '1', 'Wmk muntilan'),
(346, 806, 'Pembersihan Jalan Akibat Tumpahan BBM/Tanah Longsor/Pasir', 'Hujan deras dengan intensitas tinggi dan angin', '-', '-', 'Bapak Bambang (staf UPT DPU Pengairan salaman)', 'Atika Yumna Nurina', '082226990342', '-', 'hujan deras dengan intensitas tinggi menyebabkan akses jalan utama desa wonogiri longsor dan tidak bisa dilewati, maka saksi melapor ke Pos wmk salaman', 'setelah mendapat Laporan Team piket wmk salaman regu 3 menindak lanjuti laporan tersebut lalu melaksanakan pembersihan material tanah longsor dengan aman dan selamat dan akses jalan utama desa wonogiri sudah bisa dilewati', NULL, NULL, NULL, '14', '3', 'wmk salaman'),
(347, 807, 'Kecelakaan Lalu Lintas', 'pick up tabrak lari', ' Sdr kiki kresmanto  dan dalis saputra ', 'Kedon RT 004 RW 12 Pasuruhan Kecamatan Mertoyudan Kabupaten Magelang ', 'Bapak Sujadi (anggota IOF Rescue)', 'Khoerotul laela ', '08159519954', '-', 'kedua korban mengendarai SPM berboncengan dari arah Mertoyudan menuju kota magelang dari sisi kiri terdapat pick up melaju dengan kecepatan tinggi yang hendak mendahului dan menabrak kedua korban sehingga terpental di pembatas jalan ', 'setelah menerima laporan dari saksi tim ambulance damkar kabupaten magelang merespon laporan dengan menuju ke lokai untuk melakukan penanganan dan mobilisasi ke RSUD Tidar kota magelang dengan aman dan lancar', NULL, NULL, NULL, '13', '3', 'Induk'),
(348, 808, 'Pengambilan Sarang Tawon', 'Sarang tawon menggangu warga', '-', '-', 'Bapak fahruroji', 'Fandi Ivanudin ', '085799177350', '-', 'adanya sarang tawon yang berada dipohon samping rumah milik Bapak Fahruroji yang dianggap membahayakan penghuni rumah dan warga sekitar maka saksi melapor ke POS WMK Muntilan untuk ditindak lanjuti', 'setelah mendapatkan laporan Tim piket pos wmk muntilan menindak lanjuti laporan menyiapkan peralatan serta personil dan kemudian mengevakuasi sarang tawon tersebut dengan aman dan selamat ', NULL, NULL, NULL, '10', '3', 'wmk muntilan'),
(349, 809, 'Pengambilan Sarang Tawon', 'Sarang tawon menggangu warga', '-', '-', 'bapak aji p ', 'Danang sulistyo', '081328283994', '-', 'adanya sarang tawon yang berada di belakang gedung sekolahan karena takut membahayakan kemudian saksi melapor ke WMK salam', 'regu 1 piket wmk salam setelah mendapat laporan sarang tawon kemudian meluncur ke lokasi sarang tawon tersebut dengan aman dan lancar', NULL, NULL, NULL, '12', '1', 'wmk salam'),
(350, 810, 'Kecelakaan Lalu Lintas', 'Hilang kendali', 'Novia dan fanani', 'Dumpoh 9 RT7 RW 7 Potrobangsan Magelang Utara, Kaliangkrik Magelang ', 'Rizky Noviantoro', 'Sucipto roso ', '082225139863', '-', 'Kedua korban mengendarai sepeda motor melaju ke dari arah Muntilan menuju Magelang sesampai di lokasi di duga Tn. fanani hilang kendali sehingga menabrak Ny. Novia yang melaju di depannya  ', 'setelah mendapatkan laporan tim Ambulance Damkar Kabupaten Magelang menuju ke lokasi untuk melakukan asessment cek kondisi umum, dan evakuasi korban ke RSUD Tidar Kota Magelang ', NULL, NULL, NULL, '13', '1', 'INDUK'),
(351, 811, 'Pembersihan Pohon Tumbang', 'Hujan deras dengan intensitas tinggi dan angin', '-', '-', 'bapak maryoto', 'niken afrilia', '081393615391', '-`', 'adanya angin kencang yang terjadi di wilayah muntilan menyebabkan pohon yang berada di pinggir jalan pepe tumbang dan menimpa kabel listrik ', 'setelah mendapat laporan regu 2 WMK Muntilan mempersiapkan personil beserta peralatan dan menuju ke lokasi dan pohon yang tumbang bisa diatasi dengan aman ', NULL, NULL, NULL, '10', '2', 'wmk muntilan'),
(352, 812, 'Kecelakaan Lalu Lintas', 'saling menyalip', 'Muhammad akron syaiful atik dan gunawan ', 'kebon agung 3/5 bandongan, treko 1/5 treko kota mungkid magelang ', 'warga sekitar ', 'Yogo tri subarkah ', '081392082792', '-', 'kedua korban mengendarai sepeda motor dari arah blondo sdr. gunawan hendak berbelok kanan di kantor J&amp;T bumirejo namun Sdr. akron menyalip dari sisi kanan sehingga keduanya bertabrakan dan terjatuh ', 'setelah mendapat laporan tim regu 2 melaksanakan penanganan laka lantas dengan aman ', NULL, NULL, NULL, '13', '2', 'Induk'),
(353, 813, 'Kecelakaan Lalu Lintas', 'karena mobil berputar arah', 'Muhammad Zani', 'Jetis 04/07, Pancuranmas Kecamatan Secang Kabupaten Magelang ', 'warga sekitar ', 'yogo tri subarkah', '081392082792', '-', 'korban mengendarai sepeda motor dari arah blondo menuju Muntilan melewati jalan soekarno hatta namun didepan kantor dinas kesehatan ada mobil berputar arah sehingga keduanya bertabrakan ', 'setelah mendapat lapoan tim ambulance langsung meunju lokasi dan dilakukan evakuasi dengan aman ', NULL, NULL, NULL, '13', '2', 'induk'),
