(356, 816, 'Kebakaran Mobil', NULL, 'Bambang Nur Wicaksono ', 'Dusun Ngaran RT 01, RW 06, Desa borobudur Kecamatan Borobudur Kabupaten Magelang ', NULL, 'Gema sasmita Reksaningtyas', '085703194611', '-+ Rp 20.000.000,00', 'Pak Bambang membakar kain (sleyer) di stang sepeda motor milik saudaranya lalu ditinggal pergi yang menyebabkan motor itu terbakar di halaman rumahnya. Kemudian warga mengetahui hal itu lalu mengeluarkan motor tersebut ke pinggir jalan. Selain itu pelaku juga membakar kursi dan pakaian di dalam rumah namun api kemudian dipadamkan oleh dia sendiri.\r\nsetelah mendapatkan laporan tim induk menuju ke lokasi untuk memadamkan api dengan aman dan selamat', NULL, 'Sepeda Motor', 'kain slayer di stang sepeda motor ', 'objek terbakar: 1 sepeda motor dan kursi \r\nobjek terselamatkan : 15 rumah dan 2 warung \r\nsaksi : bapak tikno \r\n', '03,09,06,13', '2', 'Induk'),
(357, 817, 'Pengambilan Ular', 'ular yang masuk dalam rumah', '-', '-', 'pranyoto ', 'Dinda RIma Namira', '085802625251', '-', ' Pada malam hari Bapak Pranyoto sedang ke kamar mandi, tiba tiba melihat ular dari atas yang jatuh kedalam sumur. Kemudian saksi melapor ke Damkar kab.  Magrelang. ', 'Setelah mendapat laporan kemudian tim piket regu 3 induk menindak lanjuti laporan, mengevakuasi ular dengan aman dan selamat. \r\n', NULL, NULL, NULL, '08 dan 13', '3', 'Induk'),
(358, 818, 'Pembersihan Pohon Tumbang', 'angin kencang dan hujan lebat', '-', '-', 'supri', 'Fandi Ivanudin ', '085735005227', '-', 'Dikarenakan hujan disertai angin kencang yang terjadi di wilayah Muntilan, menyebabkan Pohon tumbang yang menutup jalan raya magelang jogja \r\n', 'Setelah mendapat laporan WMK Muntilan mempersiapkan personil beserta peralatan dan menuju ke lokasi dan pohon yang tumbang bisa di atasi dengan aman.\r\n', NULL, NULL, NULL, '10', '3', 'wmk muntilan'),
(359, 819, 'Penyemprotan Desinfektan', 'Corona Virus Disease 19', '-', '-', 'Satpam Rumah Dinas Bupati Kabupaten Magelang', 'Zulfa nur anisa', '085830010946', '-', 'kegiatan rutin penyemprotan desinfektan ', 'tim melaksanakan penyemprotan desinfektan dengan aman ', NULL, NULL, NULL, '08', '1', 'induk'),
