(361, 821, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', 'Dwi winangringsih', '-', 'sutras', 'Triyas Huda Pamungkas', '089510594863', '-', 'Sarang tawon yang berada di rumah Bpk Sutras yang menggangu pemilik rumah dan warga sekitar yang mengakibatkan satu orang tersengat', 'Setelah mendapat laporan, Tim piket regu 1 menindak lanjuti laporan, menyiapkan peralatan serta personil dan mengevakuasi sarang tawon tersebut dengan aman. ', NULL, NULL, NULL, '08', '1', 'induk'),
(362, 822, 'Kebakaran Bangunan', NULL, 'Bapak Joko Budi Santoso', 'Kebakaran Pabrik Kayu  \r\nUD Sejahtera, Ngasinan, Grabag, Magelang', NULL, 'Bagus Gadang Winasis', '081578956228', '-+- Rp 70.000.000,-', 'Terjadi ledakan pada mesin pengering yang menyebabkan timbulnya api, dan menyebabkan kebakaran\r\nSetelah mendapat laporan regu piket wmk grabag disusul wmk Tegalrejo , induk sawitan dan damkar kota  meluncur ke lokasi untuk memadamkan api dengan aman dan cepat', NULL, 'kayu', 'ledakan pada mesin pengering ', 'Personil yang terlibat :\r\n1. tim Wmk Grabag\r\n2. tim Wmk Tegalrejo\r\n3. tim Ziegler 03\r\n4. tim Ayax 09\r\n5. tim Tangki 06\r\n6. tim Hilux\r\n7. tim Ambulance\r\n', '03,09,06,13, ', '2', 'induk dan wmk grabag'),
(363, 823, 'Pengambilan Ular', 'ular yang meresahkan warga ', '-', '-', 'Ibu Nur Cahyati ', 'yuli riyan setiawan', '088232419401', '-`', 'Ketika Ibu Nur Cahyati mau membersihkan rumah melihat adanya ular di Atap Rumah, lalu melaporkan ke induk Damkar.', 'Setelah mendapat laporan Dari Induk, Tim Regu 2 Wmk Muntilan melakukan persiapan dan meluncur kelokasi kemudian mengevakuasi dengan aman dan selamat.\r\nSelanjutnya Ular dibawa sebelum dilepas ke tempat yang jauh dari pemukiman warga.\r\n', NULL, NULL, NULL, '08 dan 10', '2', 'induk dan wmk muntilan '),
