(383, 843, 'Kebakaran Rumah', NULL, 'Bapak Nastagin (63th) jumlah penghuni rumah : 6 jiwa', 'Dusun Banjaran 1 Dusun Nglipoh RT 03, RW 01, desa Karanganyar Kecamatan Borobudur Kabupaten Magelang ', NULL, 'Yogo tri subarkah ', '081328293994', '+- Rp 1.000.000,-', 'pemilik rumah mengeringkan kayu diatas tungku sehingga kayu kering terkena percikan api dari tungki yang menimbulkan titik api hingga merambat keatap dapur', NULL, 'dapur', 'tungku', 'tindakan : setelah mendapat laporan regu pket meluncur ke lokasi dan disusul WMK salaman sesampai dilokasi api sudah bisa dipadamkan oleh warga \r\nalat yang digunakan :\r\nnozzle 2,5 1, dan selang 2,5 1\r\nunsur yang terlibat :\r\nPolsek borburu koramil borobudur IIOF, TRC BPBD, Perangkat Desa Karanganyar', '09,06,13,14', '2', 'induk dan wmk salaman'),
