(386, 846, 'Pelepasan Cincin', 'Cincin tidak bisa dilepas', 'Fima aulia azhara ', 'kembaran kebon agung kecamatan bandongan kabupaten magelang ', 'ibu printi ana wati', 'Dinda rima namira', '085802625251', '-', 'sepulang dari pesantrem korban meminta saksi (ibu korban) untuk memakaikan cincinya pada malam harinya ketika korban hendak melepas cincin yang dipakai korban mengalamai kesulitan kemudian saksi melapor ke kantor damkar kabupaten magellang ', 'setelah mendapat laporan team piket regu 3 pos wmk bandongan mengantar korban ke kantor induk damkar selanjutnya team piket regu 3 induk menyiapkan peralatan dan melakukan pelepasan cincin dengan aman ', NULL, NULL, NULL, 'WMK Bandongan', '3', 'WMK Bandongan dan induk '),
(387, 847, 'Penyemprotan Desinfektan', 'Corona Virus Disease 19', '-', '-', 'Satpam Pengadilan Negeri Kabupaten Magelang', 'Zulfa nur anisa', '085830010946', '-', 'kegiatan penyemprotan desinfektan dilaksanakan dengan aman ', 'menyikapi perintah penyemprotan desinfektan covid 19', NULL, NULL, NULL, '08', '1', 'induk'),
