(448, 908, 'Kecelakaan Lalu Lintas', 'menabrak pohon pisang', ' Dzakiyya Silkha Uyun ', 'Nariban 01/08 Progowati Kecamatan Mungkid Kabupaten Magelang ', 'Warga yang melintas kemudia datang kekantor ', 'Muhammad Nurul Falah ', '085729361800', '-', 'saat melintas di lokasi dari arah utara korban kaget melihat ada pohon yang tumbang melitang kemudian menabrak pohon tersebut yang mengakibatkan korban terjatuh ', 'setelah mendapatkan laporan tim Ambulance Damkar kabupaten Magelang menindak lanjuti laporan dan menuju ke Lokasi untuk melakukan pertolongan stablilisasi korban, cek kondisi umum, peraawatan luka lecet, mengevakuasi korban ke RSU Muntilan ', NULL, NULL, NULL, '13', '3', 'induk'),
