(489, 949, 'Pertolongan dan Evakuasi Korban Laka Lantas', 'terkejut kaget ketika ada mobil yang akan berputar arah', 'diketerangan', 'diketerangan', 'taufik', 'Yogo tri subarkah ', '081392082792', '-`', ' Tn Arif mengendarai SPM berboncengan dengan An Athaufar dan Nn Fani, dari arah Salaman menuju Muntilan, dengan kecepatan tinggi, setibanya di Brojonalan korban terkejut kaget ketika ada mobil yang akan berputar arah dan mengakibatkan SPM menabrak mobil.\r\n', 'Setelah mendapatkan laporan tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Rawat luka\r\n4. Evakuasi korban ke RS Aisyah Muntilan', NULL, NULL, NULL, '13', '2', 'induk'),
