(496, 956, 'Pertolongan dan Evakuasi Korban Laka Lantas', 'hendak mendahului', 'Bapak Najib', '\r\nWates, Kulonprogo, Yogyakarta', 'pengendara yang melintas ', 'Khoerotul Laela ', '08159519954', '-`', 'Korban mengendarai sepeda motor hendak mendahului kendaraan didepanya. dari jalur berlawanan terdapat motor yang melaju dengan kecepatan tinggi, juga hendak mendahului pengendara yang lain. kemudian menabrak korban hingga terjatuh. sehingga mengakibatkan korban cidera kepala.', 'Setelah menerima laporan dari saksi, tim Ambulance regu 03 Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban\r\n2. Cek kondisi umum\r\n3. Perawatan luka lecet \r\n4. Pemakaian neckolar dileher\r\n5. Mengevakuasi korban ke RSUD Muntilan\r\n', NULL, NULL, NULL, '13', '3', 'induk'),
