(498, 958, 'Pengambilan Sarang Tawon', 'Sarang tawon menggangu warga', '-', '-', 'Bapak Budi', 'rizqi kurniawan ', '088215468017', '-', '1. Adanya sarang tawon yang berada di samping rumah Bpk Budi, karena takut membahayakan, kemudian saksi melapor ke WMK Bandongan.\r\n2. Adanya sarang tawon yang berada di atas mushola, karena takut membahayakan, kemudian saksi melapor ke WMK Bandongan', '1. Adanya sarang tawon yang berada di samping rumah Bpk Budi, karena takut membahayakan, kemudian saksi melapor ke WMK Bandongan.\r\n2. Adanya sarang tawon yang berada di atas mushola, karena takut membahayakan, kemudian saksi melapor ke WMK Bandongan\r\n', NULL, NULL, NULL, '04', '1', 'wmk bandongan '),
(499, 959, 'Pertolongan dan Evakuasi Korban Laka Lantas', 'Hilang kendali', 'Miftahurrohman', 'Ngargoretno Sumbersari rt 01 rw 01 Kecamatan Salaman, Kabupaten Magelang ', 'Sdr. Febi ( Anggota Satpol PP Kab. Magelang)', 'Sucipta rasa ', '082225139863', '-', 'Korban berkendara sepeda motor dari arah Mendut menuju Jogjakarta. Sesampai lokasi korban hilang kendali karena menghindari warga yang mengendarai sepeda motor tiba-tiba menyeberang jalan sehingga menyebabkan korban terjatuh', 'Setelah mendapatkan laporan tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Stabilisasi korban.\r\n2. Cek kondisi umum.\r\n3. Pembidaian kaki kanan ( susp. fraktur terbuka)\r\n4. Mengevakuasi korban ke RSU Tidar Magelang. ', NULL, NULL, NULL, '13', '1', 'Induk '),
(500, 960, 'Pengambilan Ular', 'ular yang masuk dalam rumah', '-', '-', '  Ibu Lian ( Pemilik Rumah ) ', 'Eka Nurmalitasari ', '085643132335', '- ', 'Ketika saksi melihat ular di depan Rumah , saksi melapor ke kantor Pemadam Kebakaran Kabupaten Magelang.', 'Setelah mendapat laporan, Tim melakukan persiapan dan meluncur ke rumah pelapor. Ular dapat dievakuasi dengan aman', NULL, NULL, NULL, '08', '1', 'induk '),
