(502, 962, 'Pengambilan Ular', 'ular yang masuk dalam rumah', '-', '-', 'Bapak slamet riyadi', 'Danang Sulistyo', '081328293994', '-', 'Saksi melihat ular berada di atap rumah. Karena takut membahayakan anggota keluarga, kemudian saksi langsung melapor ke WMK SALAM.', 'Setelah mendapat laporan tim piket regu 1 WMK SALAM  langsung menuju lokasi dan mengevakuasi ular tersebut dengan aman dan lancar. Setelah itu ular tersebut dirilis di tempat yang jauh dari permukiman warga.', NULL, NULL, NULL, '12', '1', 'wmk salam '),
