(504, 964, 'Pertolongan dan Evakuasi Korban Laka Lantas', 'bagi takjil korban tertabrak', 'Nn Desi Sisilia Umi Nugraheni (20 th)', 'Perum Griya Kencana Permai No 16 RT 18 RW 07 Borodudur Kab Magelang\r\n', 'Warga yang melintas', 'wisnu kusuma wardhana', '085879993822', '-', 'Korban sedang melaksanakan bagi takjil di depan lapangan Drh Soepardi, saat hendak menyeberang tiba-tiba dari arah mendut melaju SPM yang hendak mendahului mobil sehingga korban tertabrak. \r\n', 'Setelah menerima laporan, tim Ambulance Damkar  Kab. Magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan: \r\n1. Assesment\r\n2. Cek kondisi umum\r\n3. Pembidaian kaki kanan\r\n3. Evakuasi korban ke IGD RSUD Muntilan', NULL, NULL, NULL, '13', '2', 'Induk'),
(505, 965, 'Pengambilan Sarang Tawon', 'Sarang tawon menggangu warga', '-', '-', 'bapak hadi s.', 'Ridho nur cahyo ', '081542421901', '-', '1. Adanya sarang tawon yang berada di depan Warung Bpk Hadi, karena takut membahayakan, kemudian saksi melapor ke WMK Salam\r\n2. Adanya sarang tawon yang berada di pohon depan rumah bapak mujiono, karena takut membahayakan, kemudian saksi melapor ke WMK Salam', 'Regu 2 piket WMK Salam setelah mendapat laporan sarang tawon kemudian meluncur ke lokasi, semua sarang tawon tersebut dapat dievakuasi dengan aman dan lancar.', NULL, NULL, NULL, '12', '2', 'wmk salam '),
