(507, 967, 'Kebakaran Rumah', NULL, 'Ibu romlah ', 'Dusun Dawung Rt.01/Rw.07, Desa Dawung, Kecamatan Tegalrejo, Kabupaten Magelang, Provinsi Jawa Tengah ', NULL, 'Muhammad Afif Sarifudin ', '085742553827', '10.000.000,-', 'Ibu Romlah (70 tahun) memanaskan air di tungku, kemudian beliau ketiduran, dan diketahui warga sekitar api sudah merembet ke dinding bambu dapur yang berada disamping tungku, warga kemudian memadamkan api dengan peralatan seadanya.', NULL, 'dapur', 'tungku', 'personil yang terlibat :\r\n1. Muhammad jaga zaman\r\n2. Romdani\r\n3. Muhammad Mukhlis\r\n4. Muhammad  Afif S\r\n5. Muhammad Soleh\r\n6. Agus purwanto\r\n7. Muhammad Kukuh Prasetyo\r\n8. CHabib\r\n\r\n', '11', '3', 'WMK Tegalrejo'),
