(514, 974, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'Warga sekolah', 'khoerotul laela ', '08155959954', '-', 'Sarang tawon yang berada di atap lingkungan sekolah, yang membahayakan siswa  dan warga sekolah. Karena dikhawatirkan akan memakan korban, maka saksi melapor ke Damkar Kab. Magelang untuk ditindak lanjuti. Dan memanfaatkan waktu tersebut melaksanakan sosialisasi APAR', 'Setelah mendapat laporan, Tim piket menindaklanjuti laporan, menyiapkan peralatan serta personil dan mengevakuasi sarang tawon tersebut dengan aman. Kemudian melakukan sosialisasi penggunaan APAR dilingkungan sekolah.', NULL, NULL, NULL, '08', '3', 'INDUK '),
(515, 975, 'Pembersihan Pohon Tumbang', 'hujan deras di sertai angin ', '-', '-', 'warga sekitar ', 'Khoerotul Laela ', '08155959954', '-', 'hujan deras yang disertai angin kencang diwilayah bringin srumbung mengakibatakan pohon tumbang yang menutup akses jalan dan perairan sawah ', 'setelah menerima laporan kemudian tim piket regu 3 induk menuju ke lokasi dan melakukan penanganan dengan lancar dan aman ', NULL, NULL, NULL, '08', '2', 'Induk'),
(516, 976, 'Pelepasan Cincin', 'Cincin tidak bisa dilepas', 'sekar kinanthi ', 'Gunden RT Karanganyar Kecamatan Borobudur Kabupaten Magelang ', 'bapak boby (ayah korban)', 'dinda rima namira ', '085802625251', '-', 'pada malam hari korban memindahkan cincin dari jari manis ke jari tengah keesokan harinya korban akan melepas cincin tersebut tetapi tidak bisa karena kekecilen kemudian saksi bersama korban datang ke kantor pemadam kebakaran ', 'setelah saksi bersama korban datang ke kantor pemdama tim piket regu 3 induk menyiapkan peralatan dan melakukan pelepasan cincin dengan aman ', NULL, NULL, NULL, '-', '3', 'induk '),
(517, 977, 'Pembersihan Pohon Tumbang', 'hujan angin ', '-', '-', 'warga sekitar ', 'Muhammad soleh ', '08157711644', '-', 'terjadi hujan dengan intensitas tinggi siertai angin kencang di wilayah Tegalrejo dan sekitarnya menyebabkab pohon albasia tumbang menimpa jaringan PLN dan menutup akses JL. Batikan - Mangunrejo kemudian saksi melapor ke WMK Tegalrejo untuk ditinjak lanjuti ', 'setelah menerima laporan regu 2 piket wmk tegalrejo menuju ke lokasi untuk melakukan evakuasi bersama PLN Tegalrejo dengan aman dan selamat ', NULL, NULL, NULL, '11', '1', 'induk '),
(518, 978, 'Pembersihan Pohon Tumbang', 'Hujan deras dengan intensitas tinggi dan angin', '-', '-', 'warga sekitar ', 'Rizka larasita', '082136786006', '-', 'terjadi hujan dengan intensitas tinggi disertai angin kencang di wilayah salam dan sekitarnya menyebabkan pohon bambu tumbang mengenai rumah warga ', 'setelah menerima laporan regu piket WMK Salam menuju ke lokasi melakukan penyemprotan dan pembakaran dongkrak bamabu untuk mepermudah evakuasi bersama BABINSA Kadiluwih BPB, relawan, dan warga sekitar dengan aman dan lancar ', NULL, NULL, NULL, '14', '1', 'wmk salam '),
(519, 979, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'pak likin dan mas udin ', 'rian ', '0823146799998', '-`', 'dengan adanya sarang tawon yang berada di kebun dan berada di sebeleh jalan menuju area persawahan yang juga sering di lewati warga sehingga membhayakan warga yang lewat kemudian saksi melapor ke WMK Bandongan ', 'setelah mendapat laporan regu 2 wmk bandongan memeprsiapkan personil dan peralatan untuk menuju kelokasi sarang tawon kemudian sarang tawon dapat dikondisikan dengan aman dan selamat ', NULL, NULL, NULL, '04', '2', 'wmk bandongan '),
(520, 980, 'Pembersihan Pohon Tumbang', 'hujan angin ', '-', '-', 'warga sekitar ', 'Danang sulistyo ', '081328939994', '-+- Rp 70.000.000,-', 'terjadi hujan dengan intensitas tinggi disertai angin kencang di wilayah salam dan sekitarnya menyebabkan pohon bambu tumbang mengenai rumah warga kemudian saksi melapor ke WMK Salam untuk ditindak lanjuti ', 'setelah menerima laporan regu piket 1 wmk salam menuju ke lokasi untuk melaukan evakuasi bersama BABINSA kadiluwih BPBD, relawan dan warga sekitar dengan aman dan lancar', NULL, NULL, NULL, '14', '1', 'wmk salam '),
(521, 981, 'Pengambilan Sarang Tawon', 'Sarang tawon yang sudah menggangu warga', '-', '-', 'bapak ajik dan bapak hendi ', 'Muhammad Bagas Hari Murti ', '088980511835', '-', 'pada hari minggu 7 maret 2021, saudara hendi selaku security dan gardener sedang membersihkan kebun di area hotel Le Temple Borobudur, saksi mendapat sebuag sarang tawon yang membahayakan pekerja dan tamu hotel setelah itu saksi meminta rekannya (sdr. aji) untuk melapor ke Kantor Pemadam Kebakaran Kabupaten Magelang ', 'setelah menerima laporan team piket regu 3 induk menindak lanjuti laporan tersebut dengan mempersiapkan alat dan personil kemudian meluncur ke lokasi team melakukan evakuasi sarang tawon tersebut dengan aman dan kembali ke mako induk dengan selamat ', NULL, NULL, NULL, '08', '3', 'induk '),
(522, 982, 'Pembersihan Pohon Tumbang', 'hujan angin ', 'nihil', '-', 'warga sekitar ', 'Muhamamd Tri sabdono ', '085713542428', '-', 'hujan deras yang disertai angin kencang mengakibatkan pohon tumbang ', 'setelah menerima laporan wmk salam menuju ke lokasi melakukan penanganan dengan lancara dan aman ', NULL, NULL, NULL, '14', '02', 'wmk salam '),
(523, 983, 'Pengambilan Sarang Tawon', 'sarang tawon yang mengganggu ', '-', '-', 'bapak lilik eko prasetyo (anggota damkar)', 'cornelia angesthi widodo ', '081326192721', '-', 'adanya sarang tawon yang berada dibawah atap belakang rumah yang dianggap membahayakan pemilik rumah dan warga sekita ryang melintas maka saksi melapor ke kantor pemadam kebakaran kabupaten magelang ', 'setelah mendapat laporan tim induk regu 2 menindak lanjuti laporan ke lokasi, melakukan evakuasi sarang tawon dengan aman dan selamat ', NULL, NULL, NULL, '08', '2', 'induk '),
(524, 984, 'Pertolongan dan Evakuasi Korban Laka Lantas', 'tertabrak mobil dari arah berlawanan', 'Tn. Paryono (46th) dan An. Restu (5th)', 'Pranan Kulon RT 20, RW 08, Menoreh Kecamatan Salaman Kabupaten Magelang ', 'warga sekitar', 'wisnu kusuma wardhana ', '085879993822', 'belum diketahui ', 'Tn. Paryono mengendarai SPM berboncengan dengan An. Restu dari arah Borobudur menuju Salaman, namun saat melintas ringin putih Borobudur dari arah Salaman melaju mobil yang dikendarai Tn. Rusman sedang mendahului kendaraan didepannya sehingga menabrak SPM Tn. Paryono hingga korban terpental', 'setelah menerima laporan dari saksi, tim ambulance damkar kabupaten magelang menindak lanjuti laporan dan menuju ke lokasi untuk melakukan pertolongan :\r\n1. Stabilisasi korban \r\n2. Cek kondisi umum\r\n- Tn. Paryono (CKB dan Dislokasi tumit kanan)\r\n- An. Restu (kesan MD dinyatakan MD dilokasi oleh dokter RSU Muntilan pukul 14.15)\r\n3. pemasangan head stabilizer (neckolar)\r\n4. pemberian 02 masker 8 lpm (Tn. Paryono)\r\n5. Pembidaian dislokasi (Tn. Paryono)\r\n6. Evakuasi ke IGD RSUD Muntilan\r\n\r\n', NULL, NULL, NULL, '13', '2', 'induk '),
(525, 985, 'Pengambilan Sarang Tawon', 'sarang tawon yang mengganggu', '-', '-', 'ibu yuli', 'Arif prasojo ', '085713676943', '-', 'adanya sarang tawon yang berada di atap rumah ibu yuli membahayakan penghuni rumah dan warga sekitar kemudian saksi melapor ke Damkar kabupaten magelang pos wmk tegalrejo untuk ditindak lanjuti', 'setelah mendapat laporan personil wmk tegalrejo mempersiapkan peralatan kemudian meluncur ke lokasi dan mengevakuasi sarang tawon tersebut dengan aman dan selamat ', NULL, NULL, NULL, '11', '2', 'induk '),
(526, 986, 'Evakuasi Binatang Buas', 'biawak yang masuk dirumah ', '-', '-', 'Ibu salamiah ', 'Danang sulistyo', '081328293994', '-', 'saksi melihat biawak berada di rumah karena takut membahayakan anggota keluarga kemudian saksi langsung melapor ke WMK salam', 'setelah mendapat laporan tim piket regu 1 wmk salam langsung menuju lokasi dan mengevakuasi biawak tersebut dengan aman dan lancar. Setelah itu biawak tersebut dirilis ditempat  yang jauh dari permukiman warga ', NULL, NULL, NULL, '14', '1', 'wmk salam '),
(527, 987, 'Kebakaran Bangunan', NULL, 'Bu Diah (kios pakaian) - Bapak Dwi (kios snack) - Bu Sri Pujiatun ( kios snack)', 'Pasar Kaponan Desa Kaponan Kecamatan Pakis Kabupaten Magelang', NULL, 'Agus gedrik', '085714894122', '+- Rp 100.000.000,00', 'Terjadinya konsleting listrik yang mengakibatkan kios terbakar maka saksi melapor ke kantor pemadam kebakaran kabupaten Magelang.\r\nSetelah mendapat laporan Wmk Tegalrejo meluncur ke lokasi dan disusul tim induk , Wmk Grabag dan Wmk Bandongan melakukan pemadaman dengan aman dan selamat.\r\n', NULL, '2ruko', 'Listrik', 'Personil yang terlibat :\r\n1. Muhammad Jaga Jaman\r\n2. Romdani\r\n3. Agus Purwanto\r\n4. Muhammad soleh\r\n5. Muhammad Kukuh Prasetyo \r\n6. Muhammad mukhlis\r\n7. Muhammad afif\r\n8. Chabib\r\n9. Wahyu hidayat\r\n10. Rudita khoirul huda\r\n11. Rino viantoro', '- Unit Pompa WMK Tegalrejo #11 - Unit Rescue Induk', '2', 'Induk, wmk tegalrejo, wmk band');
