(505, 977, 139, '2021-03-09 20:24:00', '2021-03-09 21:10:00', 'files_1621286733072.jpeg', 'alat yang digunakan :\r\nunit ayax 11 \r\napd\r\nsenter\r\nchainsaw\r\npersonil yang terlibat :\r\nmuhammad jaga zaman \r\nromdhani \r\nmuhammad mukhlis\r\nmuhammad kukuh prasetyo \r\nmuhammad soleh \r\nagus purwanto \r\nmuhammad afif\r\nrudita khoirul huda\r\n', 'Selesai'),
(506, 978, 139, '2021-03-09 09:12:00', '2021-03-09 13:25:00', 'files_1621287262744.jpeg', 'alat yang digunakan :\r\nunit ayax 12, apd, golok, chainsaw,tambang, tangga, 2 selang 1, 1 selang 1,5 nozzle, Y connection \r\nUnsur yang terlibat:\r\nDamkar Kabupaten Magelang  (WMK Salam)\r\nTNI, (Babinsa Kadiluwih)\r\nBPBD\r\nKepala desa, Perangkat desa ,relawan dan warga sekitar \r\npersonil yang terlibat :\r\nanwari munandar \r\nridho nur cahyo \r\nmuhammad aksin fuady\r\nahmad rizal akhsan \r\nsiswanto \r\nmuhammad al baechaki \r\ndidik ade pamungkas\r\nriska larasita ', 'Selesai'),
(507, 979, 139, '2021-04-29 10:57:10', '2021-04-29 10:57:10', 'files_1621288298661.jpeg', 'alat yang digunakan :\r\nAPD, pertalite, bambu, kain \r\npersonil yang terlibat :\r\nnur sigit waluyo \r\nsalist arif mubadhin \r\ndwi marwanto \r\nmuhammad saputro \r\nmuhammad sigit setywan \r\nrian \r\ntoni setiawan \r\nmuhammad rulis \r\nbudiyarsih \r\nardi murdianto \r\nandi saputra ', 'Selesai'),
(508, 980, 139, '2021-03-08 11:30:00', '2021-03-08 15:00:00', 'files_1621288798778.jpeg', 'alat yang digunakan : \r\nunit ayax 12, APD, golok, chainsaw, tambang \r\npersonil yang terlibat :\r\nsugiyanto \r\nmitachul huda\r\nhendro satmoko \r\ndanang sulistyo \r\nfuad hasan pangestu \r\nmuh ichsan \r\ncholiq setiawan \r\nunsur yang terlibat :\r\ndamkar kabupaten magelang (wmk salam)\r\nTNI (babinsa kadiluwih)\r\nBPBD \r\nperangkat desa relawan dan warga sekitar ', 'Selesai'),
(509, 981, 139, '2021-04-29 11:12:44', '2021-04-29 11:12:44', 'files_1621289234304.jpeg,files_16212892343041.jpeg', 'peralatan yang digunakan :\r\nAPD, kapas, karung, bensin, gunting \r\npersonil yang terlibat :\r\ngunawan yudha prasteya \r\nabi akbar assani \r\nlistiyanto \r\nfatchurohman \r\nmuhammad bagas harimurti \r\nnur nuhammad ali azhar', 'Selesai'),
(510, 982, 139, '2021-03-07 14:30:00', '2021-03-07 15:30:00', 'files_1621289843084.jpeg', 'alat yang digunakan : \r\napd, chainsaw, golok, tangga, webbing, \r\npersonil yang terlibat :\r\nabi akbar assani \r\nadi susanto \r\nhadi jatmiko \r\nfauzi \r\nkrisna hanif harinda \r\nmuhammad tri sabdono \r\nrizky noviantoro \r\n', 'Selesai'),
(511, 983, 139, '2021-04-29 20:00:00', '2021-04-29 21:40:00', 'files_1621376352108.jpeg', 'alat yang digunakan :\r\nsenter, APD, Bensin, tangga, karung, botol spray \r\npersonil yang terlibat :\r\nsetyo widiatmoko \r\nsony octavianto\r\nmustaqim\r\ndwi aryanto\r\ndekky swargana \r\ncornelia angesthi krisinanda\r\nlimpung ', 'Selesai'),
(512, 984, 139, '2021-04-29 13:40:00', '2021-04-29 14:45:00', 'files_1621378073907.jpeg', 'peralatan yang digunakan :\r\nhandscoon\r\nmasker\r\nhelm apd\r\nneckolar\r\n02 Transport \r\nBidai\r\nMitella\r\nScoop Strecher\r\ninstansi yang terlibat :\r\nDamkar kabupaten Magelang \r\nPos Lantas Borobudur \r\nPemdes Borobudur (ambulance)\r\npersonil yang terlibat :\r\nkiswoto \r\nyogo tri subarkah \r\nwisnu kusuma wardhana\r\nbramantyo dwi lestanto \r\nhendrajid megatala ', 'Selesai'),
(513, 985, 139, '2021-04-28 20:00:00', '2021-04-28 20:31:00', 'files_1621382036713.jpeg', 'alat yang digunakan :\r\nunit 11, APD, BBM, Karung, tangga, kapas, senter, \r\npersonil yang terlibat :\r\nchabib\r\nprasetyo iman nugroho \r\nfebriyan ramadhani \r\nwahyu ardanto\r\ndzakia toyib muhammad \r\nseptian dwi cahyo \r\narif prasojo ', 'Selesai'),
(514, 986, 139, '2021-04-28 17:20:00', '2021-04-28 17:50:00', 'files_1621383441170.jpeg', 'personil yang terlibat :\r\nSugiyanto \r\nMiftachul Huda\r\nHendro satmoko \r\nDanang sulistyo \r\nMuh Ichsan \r\nFuad Hasan Pangestu \r\nCholiq setiawan ', 'Selesai'),
(515, 987, 139, '2021-05-03 02:44:00', '2021-05-03 04:34:00', 'files_1621626902472.jpg', '\r\n\r\nObyek Terselamatkan :\r\n15 kios\r\n4 rumah warga\r\n\r\nAlat Yang Digunakan :\r\n1. Nozzle 2,5  : 1\r\n2. Nozzle 1.5.  : 4\r\n3. Selang 2.5   : 15\r\n4. Selang 1.5   : 4\r\n5. Y conection : 2\r\n6. Garu / Cengkek : 7\r\n7. Cangkul : 2\r\n\r\nInstansi &amp; Unsur Terlibat :\r\n1. Damkar Kabupaten Magelang\r\n2. Polsek Pakis \r\n3. Koramil Pakis\r\n4. Relawan \r\n5. Warga \r\n\r\n', 'Selesai');
